css:
@-moz-document domain("lua.org") {
html, body, pre, p.warning, code
{
    background: #333;
    color: #bbb;
}

code
{
    padding: 3px;
}

pre
{
    padding: 15px;
}

a, h1, h2
{
    color: #b58e3b
}

a:link, a:visited
{
    color: #597cc8;
}

a:link:hover, a:visited:hover
{
    border-radius: 0;
    padding: 3px;
    background: #999;
}

body
{
    color: #aaa;
    border: none;
    border-radius: 0;
    background: #444;
}
}
